import famimg from "../../img/newfam.png";

export class Landing extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col" />
          <div className="col">
            <img src={famimg} width=""/>
          </div>
        </div>
        <div className="row" />
      </div>
    );
  }
}

export default Landing;
